      out.write("\topinión, (ii) fines históricos, científicos o estadísticos, (iii)encuestas de caracterización para\r\n");
      out.write("\tfortalecer programas, (iv) encuestas procesos de autoevaluación institucional, (v)encuestas de\r\n");
      out.write("\tpercepción con fines de acreditación y/o reacreditación institucional, (vi)encuestas de\r\n");
      out.write("\tseguimiento; y (vii) Las demás finalidades que con ocasión del cumplimiento de su objeto\r\n");
      out.write("\trequieran obtención de datos personales para su tratamiento, y en todo caso de acuerdo con\r\n");
      out.write("\tla ley.\r\n");
      out.write("\t<br>\r\n");
      out.write("\t<strong>3. Medios:</strong> Las comunicaciones derivadas de las anteriores finalidades, se podrán realizar a\r\n");
      out.write("\ttravés de medios análogos, físicos y electrónicos y cualquier otro conocido o por conocer, por\r\n");
      out.write("\tparte de la <strong>USCO</strong> y por parte de la entidad con quien la Universidad tenga convenio para\r\n");
      out.write("\tejecutar las actividades descritas en las finalidades.\r\n");
      out.write("\t<br>\r\n");
      out.write("\t<strong>4. Uso:</strong> Con el consentimiento de este documento, autoriza al tratamiento de los datos\r\n");
      out.write("\tregistrados para su procesamiento, recolección, almacenamiento, uso, custodia, circulación,\r\n");
