      out.write("\t<br>\r\n");
      out.write("\t<strong>5. Transmisión:</strong> En caso que la custodia y almacenamiento sea realizado por una entidad con la\r\n");
      out.write("\tque USCO tenga relación contractual o convencional, autoriza para la transmisión de sus datos\r\n");
      out.write("\tpersonales, incluyendo los datos personales sensibles a un tercer país, que cuenta con los\r\n");
