      out.write("\t<br>\r\n");
      out.write("\t<strong>6. Responsable:</strong> La Universidad actuará como responsable del Tratamiento de Datos Personales\r\n");
      out.write("\tde los cuales es usted titular; conforme la política de Tratamiento de Datos Personales de la\r\n");
      out.write("\tUSCO disponible en la página web www.usco.edu.co y para sus fines misionales.\r\n");
      out.write("\t<br>\r\n");
      out.write("\t<strong>7. Datos sensibles:</strong> Es de carácter facultativo del titular del dato, responder preguntas que\r\n");
