      out.write("\t<br>\r\n");
      out.write("\t<strong>8. Derechos del Titular:</strong>Usted tiene derecho a conocer, actualizar y corregir sus datos\r\n");
      out.write("\tpersonales. Podrá materializar estos derechos mediante el procedimiento de “Reclamos”.\r\n");
      out.write("\t<br>\r\n");
